import { Box } from '@mui/material';
import { AppDrawer, AppBar } from '.';

type Props = {
   children: React.ReactNode;
};

export const Layout: React.FC<Props> = ({ children }) => {
   return (
      <Box
         sx={{
            display: 'flex',
            overflowX: 'scroll',
            scrollbarGutter: 'auto',
            maxHeight: '100vh',
         }}
      >
         <AppBar />
         <AppDrawer />

         {children}
      </Box>
   );
};
